class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        def cut(ls, max_len):
            cur_max_len = max_len
            cache = ""
            if len(ls) > max_len:
                for i, val in enumerate(ls):
                    position = cache.find(val)
                    if position >= 0:
                        break
                    else:
                        cache += val
                cur_max_len = max(len(cache), cur_max_len)
                remain = ls[position + 1:]
                if remain:
                    cur_max_len = cut(remain, cur_max_len)
            return cur_max_len
        cut(s,0)
        # try:
        #     return cut(s, 0)
        # except Exception as e:
        #     return e

class Solution2(object):
    def lengthOfLongestSubstring(self, s):
        if s:
            window = ""
            max_len = 0
            cur_len = 0
            for i, val in enumerate(s):
                pos = window.find(val)
                if pos >=0:
                    window = window[pos+1:] + val
                    cur_len = len(window)
                else:
                    window += val
                    cur_len +=1
                max_len = max(cur_len,max_len)
            return max_len
        else:
            return 0

